	add("crucible", "{\"term\":\"crucible\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027crucibulum\u0027 (night-lamp, metallurgic melting-pot) apparently a derivative of \u0027crux\u0027 () perhaps by analogy to \u0027th≈´ribulum\u0027 (censer) and suffix \u0027-bulum\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cup-shaped piece of laboratory equipment used to contain chemical compounds when heating them to very high temperatures\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A heat-resistant container in which metals are melted, usually at temperatures above 500¬∞C, commonly made of graphite with clay as a binder\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The bottom and hottest part of a blast furnace; the hearth\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A very difficult and trying experience, that acts as a refining or hardening process\", \"priority\":4}]}, \"synonyms\":{}}");

