	add("crudeness", "{\"term\":\"crudeness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|crude|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being crud\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A crude act or characteristic\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1960\u0027\u0027, Henry Steele Commager, \u0026quot;Is Ivy Necessary?\u0026quot; \u0027Saturday Review\u0027, vol. 43, 17 Sep., p. 86\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"We will never eliminate the \u0027\u0027crudenesses\u0027\u0027, the anti-intellectual rules, the mucker pose in higher education, until we give the universities back to faculty and students\", \"priority\":4}]}, \"synonyms\":{}}");

	add("crudity", "{\"term\":\"crudity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027crudit√©\u0027 from Latin {{m|la|cr≈´ditƒÅs}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being crude\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A crude act or characteristic\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1889\u0027\u0027, Oscar Wilde, \u0026quot;The Decay Of Lying: An Observation,\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"What Art really reveals to us is Nature\u0027s lack of design, her curious \u0027\u0027crudities\u0027\u0027, her extraordinary monotony, her absolutely unfinished condition\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Indigestion; undigested food in the stomach; badly-concocted humours\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"II.ii.1.2\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"For there is no meat whatsoever, though otherwise wholesome and good, but if unseasonably taken, or immoderately used, more than the stomach can well bear, it will engender \u0027\u0027crudity\u0027\u0027 and do much harm\", \"priority\":7}]}, \"synonyms\":{}}");

