	add("crudzine", "{\"term\":\"crudzine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|crud|zine|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A low-quality fanzine\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"lt;nowiki\u0026gt;\u0026lt;nostalgic sigh\u0026gt;\u0026lt;/nowiki\u0026gt; I remember the cover I stuck on my \u0027\u0027crudzine\u0027\u0027 at the time of the first Jersey Eastercon... two top-hatted and tiara\u0027d toffs saying \u0026quot;Hurrah! what fun at Jersey in \u002789\u0026quot;.\u0026lt;br /\u0026gt;Nobody seemed to take any notice. But then, it _was_ a very _cruddy_ \u0027\u0027crudzine\", \"priority\":2}]}, \"synonyms\":{}}");

	add("cruet", "{\"term\":\"cruet\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027cruet\u0027 diminutive of Old french (842-ca. 1400) \u0027crue\u0027 (an earthen pot) {{wikipedia}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small bottle or container used to hold a condiment, such as salt, pepper, oil, or vinegar, for use at a dining table\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1851\u0027\u0027, w:Herman Herman Melville, \u0027w:Moby Moby Dick\u0027, s:Moby-Dick/Chapter chapter 1\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Mrs. Hussey soon appeared, with a mustard-pot in one hand and a vinegar-\u0027\u0027cruet\u0027\u0027 in the other, having just broken away from the occupation of attending to the castors, and scolding her little black boy meantime\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A stand for these containers\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"even had a second slice of lamb, for he was hungry. During the meal, as was his custom, he read from a book propped up against the \u0027\u0027cruet\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A small vessel used to hold wine or water for the Eucharist\", \"priority\":6}]}, \"synonyms\":{}}");

