	add("cruft", "{\"term\":\"cruft\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Circa 1959, MIT {{w|Tech Model Railroad Club}}.\u0026lt;ref\u0026gt;{{w|Peter Samson}}, [http://www.gricer.com/tmrc/dictionary1959.html AN ABRIDGED DICTIONARY of the TMRC LANGUAGE] June 1959 (with 2005 commentary)\u0026lt;/ref\u0026gt; {{unk.|lang\u003den}} origin; possibly from Cruft Hall, built in 1915 as a gift from a donor named Harriet Otis Cruft.\u0026lt;ref\u0026gt;{{cite web|url\u003dhttp://www.thecrimson.com/article/1916/3/10/bronze-tablet-erected-in-cruft-memorial/|title\u003dBronze Tablet Erected in Cruft Memorial Laboratory|website\u003dthecrimson.com|accessdate\u003d26 November 2014}}\u0026lt;/ref\u0026gt; Cruft Hall was the radar laboratory of w:Harvard|Harvard\u0027s physics department during the Second World War, which contained much old and unused technical equipment. Possibly {{blend|crust|fluff|nocap\u003d1|lang\u003den}}, both of which suggest things that are obsolete and superfluous, or influenced by {{m|en|crud}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Anything old or of inferior quality\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Redundant, old or improperly written code, especially that which accumulates over time; clutter\", \"priority\":2}]}, \"synonyms\":{}}");

