	add("crumb", "{\"term\":\"crumb\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) {{m|enm|crumme}}, {{m|enm|cromme}}, {{m|enm|crume}}, {{m|enm|crome}}, from Old english (ca. 450-1100) \u0027cruma\u0027 (crumb, fragment) from Proto-germanic {{m|gem-pro|*krum√¥}}, {{m|gem-pro|*kr≈´m√¥||fragment, crumb}}, from Proto-indo-european {{m|ine-pro|*gr≈´-mo-||something scraped together, lumber, junk; to claw, scratch}}, from {{m|ine-pro|*ger-||to turn, bend, twist, wind}}. The \u0027b\u0027 is excrescent, as in \u0027limb\u0027 and \u0027climb\u0027; and appeared in the mid 15th century to match \u0027crumble\u0027 and words like \u0027dumb\u0027, \u0027numb\u0027, \u0027thumb\u0027. Cognate with Dutch {{m|nl|kruim||crumb}}, Low German {{m|nds|Krome}}, {{m|nds|Krume||crumb}}, German {{m|de|Krume||crumb}}, Danish {{m|da|krumme||crumb}}, Swedish dialectal {{m|sv|krumma||crumb}}, Swedish in{{m|sv|inkr√•m|kr√•m|crumbs, giblets}}, Icelandic {{m|is|krumur||crumb}}, Latin {{m|la|gr≈´mus||a little heap}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small piece which break breaks off from baked food (such as cake, biscuit or bread\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"xvi. 2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"desiring to be fed with the \u0027\u0027crumbs\u0027\u0027 which fell from the rich man\u0027s tabl\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"At twilight in the summer there is never anybody to fear‚Äîman, woman, or cat‚Äîin the chambers and at that hour the mice come out. They do not eat parchment or foolscap or red tape, but they eat the luncheon \u0027\u0027crumbs\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A bit, small amount\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The soft internal portion of bread, surrounded by crust\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Old son\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Dust unto dust, what must be, must; / If you can\u0027t get \u0027\u0027crumb\u0027\u0027, you\u0027d best eat crust\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A mixture of sugar, cocoa and milk, used to make industrial chocolate\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A nobody, worthless person\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A body louse\", \"priority\":11}]}, \"synonyms\":{}}");

	add("crumpet", "{\"term\":\"crumpet\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"17th century, either from \u0027crompid cake\u0027 () from \u0027\u0027 form of \u0027crumpen\u0027 () cognate to \u0027\u0027 Alternate etymology is from compare Breton \u0027krampouezh\u0027 () and Welsh \u0027crempog\u0027 () Sense of ‚Äúdesirable woman‚Äù attested 1936, possibly as cockney rhyming slang for \u0027\u0027 alternatively, compare \u0027tart\u0027 () (itself possibly cockney rhyming slang for \u0027\u0027 or \u0027\u0027 . Note that muffin has a similar sense, and that, in 19th and early 20th centuries, \u0026quot;Muffins and crumpets\u0026quot; was a familiar street-cry in UK.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of savoury cake, typically flat and round, made from batter and yeast, containing many small holes and served toasted, usually with butter\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person (or, collectively, persons) considered sexually desirable\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"was famously described as \u0026quot;the thinking man\u0027s crumpet\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"John and his mates have gone out to find themselves some crumpet\", \"priority\":4}]}, \"synonyms\":{}}");

