	add("cruor", "{\"term\":\"cruor\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"Latin {{lena}}, blood. See \u0027crude\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The colouring matter of the blood\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The clotted portion of coagulated blood, containing the colouring matter; gore\", \"priority\":2}]}, \"synonyms\":{}}");

	add("crupper", "{\"term\":\"crupper\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Proto-Germanic\", \"anglo-norman\"], \"text\":\"From Anglo-norman {{m|fro|cropere}}, from Old french (842-ca. 1400) {{m|fro|cropiere}}, from the same Proto-germanic root as {{m|en|croup}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A strap, looped under a horse\u0027s tail, used to stop a saddle from slipping\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1663\u0027\u0027, Hudibras\u0027, by Samuel Butler, part 1, s:Hudibras/Part 1/Canto canto 1\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Our knight did bear no less a pack / Of his own buttocks on his back: / Which now had almost got the upper- / Hand of his head, for want of \u0027\u0027crupper\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1784\u0027\u0027, Alonzo Fernandez de Avellaneda, \u0027A continuation of the history and adventures of the renowned Don Quixote de la Mancha\u0027, tr. William Augustus Yardley, \u0027The Novelist\u0027s Magazine\u0027 volume 16, page 112\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"he e≈øpied a mule\u0027s \u0027\u0027crupper\u0027\u0027, which hung to the ceiling of the room; this he took down, and tendering it to Don Quixote, went on, ≈øaying\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Captain went out in the cab all the morning. Harry came in after school to feed me and give me water. In the afternoon I was put into the cab. Jerry took as much pains to see if the collar and bridle fitted comfortably as if he had been John Manly over again. When the \u0027\u0027crupper\u0027\u0027 was let out a hole or two it all fitted well. There was no check-rein, no curb, nothing but a plain ring snaffle. What a blessing that was\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1882\u0027\u0027, Edmondo de Amicis, \u0027Morocco: Its People \u0026amp; Places\u0027, tr. C. Rollin-Tilton\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"I sought among the mules one with a mild expression of generosity and gentleness in its eyes, and found it in a white mule with a \u0027\u0027crupper\u0027\u0027 adorned with arabesques\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The buttocks or rump, especially of a horse\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A piece of armour covering the hindquarters of a horse\", \"priority\":10}]}, \"synonyms\":{}}");

	add("cruse", "{\"term\":\"cruse\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"Icelandic\"], \"text\":\"From Middle english (1100-1500) \u0027crouse\u0027 from Old english (ca. 450-1100) {{m|ang|cr≈´se||jar, cruse}}, from Proto-germanic {{m|gem-pro|*kr≈´s≈çn}}, {{m|gem-pro|*kr≈´saz||jar, pot, collar, jug}}. Cognate with German \u0027krause\u0027 (pot with a lid) Icelandic \u0027kr√∫s\u0027 (jar, jug) Merged with Middle english (1100-1500) \u0027croo\u0027 (pot, pitcher) from Old english (ca. 450-1100) {{m|ang|cr≈çg||crock, pitcher, vessel}}. More at {{l|en|crock}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small jar used to hold liquid, such as oil or water\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An oil lamp or similar emblem\", \"priority\":2}]}, \"synonyms\":{}}");

